import React from 'react';
import styled from 'styled-components';
import { CardList } from '../data';

const CardWrapper = styled.div`

    display: flex;
    padding: 15px;
`;

const Container = styled.div`

    border-radius: 10px;
    box-shadow: 2px 2px 10px darkgray;
    height: 250px;
    width: 500px;
    margin: auto;
    margin-top: 100px;

`;

const CardDetailsWrapper = styled.div`

`;

const CardImg = styled.img`
    height: 220px;
`;

const CardInfoWrapper = styled.div`
    color: black;
`;

const Card = () => {
    return (
        <Container >
            <CardWrapper CardList={CardList} >
                {CardList.map(item => (

                    <CardDetailsWrapper>
                        <CardImg src={item.img} /> 
                        <CardInfoWrapper>
                            {item.title}
                        </CardInfoWrapper>
                    </CardDetailsWrapper>



            ))}
            </CardWrapper>
        </Container>
  );
};

export default Card;
